class Solution {
    func numMatchingSubseq(_ S: String, _ words: [String]) -> Int {
        var cnt=0
        let sArr=Array(S.utf16)
        let limit=sArr.count
        for word in words{
            var i=0
            let wArr=Array(word.utf16)
            for c in wArr{
                if let index=sArr[i..<limit].index(of:c) {
                    i=index+1
                    // print(String(c)+"---"+S[index..<S.endIndex])
                }
                else {
                    cnt-=1
                    break
                }
            }
            cnt+=1
        }
        return cnt
    }
}
